import React from "react";
import { Nav, Dropdown } from "rsuite";

const EditorMenu = () => {
  const themes = [
    "monokai",
    "github",
    "tomorrow",
    "kuroir",
    "twilight",
    "xcode",
    "textmate",
    "solarized dark",
    "solarized light",
    "terminal",
  ];
  return (
    <div
      style={{
        width: "15rem",
        marginTop: "1rem",
        marginLeft: "21rem",
        marginBottom: "0.5rem",
      }}
    >
      <Nav>
        <Dropdown title="Themes">
            {
                themes.map(theme =>(
                    <Dropdown.Item>
                        {theme}
                    </Dropdown.Item>
                ))
            }
          <Dropdown.Item>monokai</Dropdown.Item>
          <Dropdown.Item>github</Dropdown.Item>
          <Dropdown.Item>tomorrow</Dropdown.Item>
        </Dropdown>
        <Dropdown title="Editor Mode">
          <Dropdown.Item>JavaScript</Dropdown.Item>
          <Dropdown.Item>Python</Dropdown.Item>
          <Dropdown.Item>Java</Dropdown.Item>
          <Dropdown.Item>Text</Dropdown.Item>
        </Dropdown>
      </Nav>
    </div>
  );
};

export default EditorMenu;
